;; **
;;; ### Loops
;;; 
;;; Given _GrapeVine_'s functional design, loops in graph programs are usually recursive in nature. Of course, we can use Clojure's loop/recur form to write such loops. However, _GrapeVine_ provides predefined _looping macros_ to make this easier
;;; 
;;; #### N-times
;;; 
;;; The simplest looping simply repeats a given sequence of operations for a specified number of times. Each iteration uses the result of the previous iteration as the input _grape_. The n-times macro uses the `->n*` symbol and has the general form `(->n* start n op1 op2 .. opm)`, where `start` is the input _grape_, `n` specifies the number of iterations, and `op1 op2 .. opm` are operations on _grapes_ (e.g., transformations and constraint checks).
;;; 
;;; The simple example below applies 10 times the rule `hello` to an initially empty graph:
;; **

;; @@
(->n* (newgrape) 10 hello)
(view _)
