;; **
;;; ### An example: Ferryman
;;; 
;;; To see the difference between _until_ and _until-distinct_, consider the well-known [Wolf-Goat-Cabbage (well, Wolf-Goat-Grape riddle)](https://en.wikipedia.org/wiki/Wolf,_goat_and_cabbage_problem) as an example.
;;; 
;;; ![](https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR2oOF_FkUK6LG03_yNh3Tun6sX7Cmh4qIixQ&usqp=CAU)
;;; 
;;; Below is specification of the problem. Rule `setup-ferryman` creates the starting situation. The ferryman can either take one item to the other side  (rule `ferry_one_over`) or he can cross without cargo (rule `cross_empty`). 
;;; 
;;; Then we have defined two graph constraints. The first one for testing the dangerious situation where a thing can be eaten (if unattended) and the second one to check whether we have solved the ridle (all on the other side).
;; **

;; @@
(list

 (rule setup-ferryman []
       (create
        (node tg:Thing {:kind "'Goat'"})
        (node tc:Thing {:kind "'Grape'"})
        (node tw:Thing {:kind "'Wolf'"})
        (node s1:Side {:name "'This side'"})
        (node s2:Side {:name "'Other side'"})
        (node f:Ferry)
        (edge :is_at tg s1)
        (edge :is_at tc s1)
        (edge :is_at tw s1)
        (edge :is_at f s1)))

 (rule ferry_one_over []
       (global INJ)
       (read (node s1:Side)
             (node s2:Side)
             (node f:Ferry)
             (node t:Thing)
             (edge et:is_at t s1)
             (edge e:is_at f s1))
       (delete e et)
       (create
        (edge :is_at f s2)
        (edge :is_at t s2)))

 (rule cross_empty []
       (global INJ)
       (read (node s1:Side)
             (node s2:Side)
             (node f:Ferry)
             (edge e:is_at f s1))
       (delete e)
       (create
        (edge :is_at f s2)))

 (constraint can-eat! [t1 t2]
             (node t1:Thing {:kind "'&t1'"})
             (node t2:Thing {:kind "'&t2'"})
             (node s:Side)
             (node s2:Side)
             (edge :is_at t1 s)
             (edge :is_at t2 s)
             (node f:Ferry)
             (edge :is_at f s2))

 (constraint all_on_the_other_side! []
             (node tg:Thing {:kind "'Goat'"})
             (node tc:Thing {:kind "'Grape'"})
             (node tw:Thing {:kind "'Wolf'"})
             (node s2:Side {:name "'Other side'"})
             (edge :is_at tg s2)
             (edge :is_at tc s2)
             (edge :is_at tw s2)))

