;; <=

;; **
;;; Given that the number of triangles grow exponentially, so does the effort transforming them in each generation. We can see this reflected in the runtime required for executing the parallel transformations:
;; **

;; @@
(debug! false)
(deleteall)
(def g0 (setup (newgrape)))
(println "Gen 1") (time (step* g0))  (def g1 _)
(println "Gen 2") (time (step* g1))  (def g2 _)
(println "Gen 3") (time (step* g2)) (def g3 _)
(println "Gen 4") (time (step* g3))  (def g4 _)
(println "Gen 5") (time (step* g4))  (def g5 _)
(println "Gen 6") (time (step* g5))   (def g6 _)
(println "Gen 7") (time (step* g6))  (def g7 _)
(println "Gen 8") (time (step* g7))   (def g8 _)
(println "Gen 9") (time (step* g8))  (def g9 _)
;; @@
